import HttpHelper from './HttpHelper';

class TableDataService {
    constructor() {
        this.httpHelper = new HttpHelper();
    }

    getTables(onSuccess, onFailure) {
        let tables = ["one", "two", "three"]
        let data = {
            data: tables
        }
        onSuccess(data);
        // this.httpHelper.get('/api/table/list-all', onSuccess, onFailure)
    }

    getTables(table, onSuccess, onFailure) {
        let data = {
            data: [
                {
                    name: "Piet",
